import React from 'react'
import "./Products.css"

function ProductBox({ name, description, image }) {
  return (
      <div>
          <h1>{name}</h1>
          <h5>{description}</h5>
          <img src={`${image}`} alt={name} />
    </div>
  )
}

export default ProductBox
